USE roboy;

DROP TABLE IF EXISTS Movies;
CREATE TABLE Movies (
        SN int auto_increment primary key,
        Name varchar(60),
        IMDB decimal(3,1),
        Rating varchar(5),
        Year varchar(4),
        Origin varchar(60),
        Language varchar(60),
        Director varchar(60),
        Genre  varchar(70),
        Franchise varchar(50),
        Thumbnail varchar(100),
        imdbThumbnail varchar(150),
        Wikipedia varchar(100),
        Liked varchar(5),
        Bookmarked varchar(5),
        Watched varchar(5),
        Trailer varchar(20)
    );


DROP TABLE IF EXISTS Series;
CREATE TABLE Series (
        SN int auto_increment primary key,
        Name varchar(60),
        IMDB decimal(3,1),
        Episodes int,
        Year varchar(4),
        Origin varchar(50),
        Creater varchar(60),
        Director varchar(60),
        Network  varchar(20),
        Genre  varchar(60),
        Thumbnail varchar(100),
        imdbThumbnail varchar(150),
        Wikipedia varchar(100),
        Liked varchar(5),
        Bookmarked varchar(5),
        Watched varchar(5),
        Trailer varchar(20)
    );


DROP TABLE IF EXISTS IsroLaunches;
CREATE TABLE IsroLaunches (
        SN int auto_increment primary key,
        FlightName varchar(20),
        Config varchar(10),
        Date varchar(12),
        LaunchSite varchar(30),
        Payloads varchar(300),
        PayloadsNos varchar(3),
        Mass varchar(10),
        Orbit varchar(15),
        Result varchar(15)
    );

